Continual challenges and definitely a diversity of highs and lows.  The last three weeks have been exceptionally exhausting.  Still... It is good to step back and reflect on the good that still exists, the positives we have around us, and keep our own perspectives  in check.  As has been said, it is always easier to be negative rather than positive and I feel it is always easier to inflate the negative in our view to where we become blind to the positive.  I have those moments, we all have those moments, but I want to take a second to remind myself of  and celebrate the positive.

Today marks 5 years of sobriety for me.  5 years wow.  I am more astounded at that 5 years than I am at the 11 years I spent drinking.  Just as I am more astounded at the fact that it's been 8¬Ω years since I ate meat rather than all the years I did.  5 years where I was able to shake myself from a dense fog, find I was not in the right place or right mind in many ways, and discover a whole new me with many opportunities for growth.  5 years that have seen my entire world go through a metamorphosis.  5 years that I see as 5 of the most valuable years of my life. 

And I must not take for granted that I have my health.  I have a roof over my head and food to create with and eat.  I have a job that has not been lost due to the national events and climate.  I have supportive family and friends, even when I am known to keep my distance.  I have been given a fresh take on so many aspects of life.  I have been ever so fortunate to have found not only an amazing friend, but also an exceptional partner who walks with me, not in front of or beside me, and who has inspired me to have a whole new understanding of what a relationship can be, what a partnership should be, and what love is capable of being.  @marisam_09 has brought such an amazing and supportive light into my world and I am ever so thankful for her. (Continued in the comments)";}i:186;a:1:{s:14:"comments_count";i:2;}i:187;a:1:{s:11:"likes_count";i:11;}i:188;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvJcf8B8vd";}i:189;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118702003_168984344799722_4207391193897280868_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=Tvve2EvERwIAX_gLJTA&oh=a32803b62b61765f1c568bb5386ccc84&oe=5F7E4746";}i:190;a:1:{s:4:"type";s:7:"sidecar";}i:191;a:1:{s:8:"owner_id";i:7701174108;}i:192;a:1:{s:14:"owner_username";s:0:"";}i:193;a:1:{s:14:"owner_fullname";s:0:"";}i:194;a:1:{s:9:"owner_pic";s:0:"";}i:195;a:1:{s:2:"id";s:19:"2391170863817781676";}i:196;a:1:{s:10:"short_code";s:11:"CEvJTtPH3Gs";}i:197;a:1:{s:12:"created_time";i:1599269801;}i:198;a:1:{s:7:"caption";s:659:"Rawsagna for dinner anyone? I mean this was so tasty. The beautiful thing about eating food in its‚Äô natural state, is that you ‚Å£get to experience all of the flavors and textures. My favorite part was the cashew nut cheese + walnut meat. 
